// Complete the substrCount function below.
function substrCount(n, s) {
    console.log(n);
    console.log(s)
    let count = 0;
    // Check two or more characters is same

    for ( var x = 0; x < s.length; x++ ) {

        for( var y = x + 1; y < s.length; y++ ) {
            if( s[x] === s[y]) {
                count += 1;
            } else {
                break;
            }
        }
    

        // Middle substr 
        // Check lates element
        if (s[x] !== s[x + 1] && s[x] === s[x + 2]) {
            count += 1;
        }
    }

    console.log(count + n)

}


const n = 4;
